window.bookSummaryJSON = "<p>Stellan’s always been a pretty horrible ex-boyfriend, but he takes it to a new level when he kidnaps me.</p> <p>I wake up in a trunk, determined to make him pay.</p> <p>But Stellan needs answers about his sister’s disappearance.</p> <p>And I need them too.</p> <p>So even if he does deserve to die for what he’s done to me, we form a tentative alliance.</p> <p>We go back to where it all began, Stellan’s childhood home. The Demon’s house next door watches over our search.</p> <p>It’s not only the house that seems to loom over us.</p> <p>Ghosts from my past know everything that happened to Sophia.</p> <p>And they want to see me embrace my father’s legacy. Or die. They aren’t too picky.</p> <p>My other a**holes aren’t too happy with Stellan’s disappearing act, but they’ll go along with helping…for now.</p> <p>Can Stellan and I find what happened to Sophia, despite the hate and lust that pulses between us?</p> <p>Or will my father’s old friends leave us buried alongside Sophia?</p> <p>Book three of the Rich Demons of Darkwood series<br> <br> Recommended for listeners 18 and up due to mature language, adult situations, triggers, and sensitive content.</p>"; 
